/// Creates a [SfGlobalLocalizations] instance for the given `locale`.
///
/// All of the function's arguments except `locale` will be passed to the [
/// SfGlobalLocalizations] constructor. (The `localeName` argument of that
/// constructor is specified by the actual subclass constructor by this
/// function.)
///
/// The following locales are supported by this package:
///
/// {@template flutter.localizations.material.languages}
///  * `af` - Afrikaans
///  * `am` - Amharic
///  * `ar` - Arabic
///  * `az` - Azerbaijani
///  * `be` - Belarusian
///  * `bg` - Bulgarian
